import React, { useEffect, useState } from 'react'

const Security = () => {
    const [people, setPeople] = useState([])

    useEffect(() => {
        const getPeople = async () => {
            await axios.post('http://localhost:4000/getPeople')
                .then((vis) => setPeople(vis.data))
                .catch((err) => console.log(err))
        }
        getPeople();
    }, [])

    console.log(people)

    return (
        <div className="register">
            <h1>Monitoring people Entering the university</h1>

        </div>
    )
}

export default Security
